query:
{
  repository(owner: "masterysystems", name: "mastery-frontend") {
    nameWithOwner
    object(expression: "master") {
			commitUrl

      ... on Commit {
        oid
        history(first: 100, since: "2022-06-22T04:37:29Z") {
          nodes {
            oid
            messageHeadline

            author {

              user {
                login

              }
            }
            committedDate
						additions
						deletions
          }
        }
      }
    }
  }
}
